
function Do-CopyFile($source, $destination) {
    $parentPath = Split-Path -parent $destination
    if (-not (Test-Path $parentPath)) {
        new-item $parentPath -ItemType Directory
    }
    Copy-Item $source $destination
    if (-not (Test-Path $destination)) {
        Write-Error ("Failed to create $destination")
    }
}

function Do-MoveFile($source, $destination) {
    $parentPath = Split-Path -parent $destination
    if (-not (Test-Path $parentPath)) {
        new-item $parentPath -ItemType Directory
    }
    Move-Item $source $destination
    if (Test-Path $source) {
        Write-Error ("Failed to delete $source")
    }

    if (-not (Test-Path $destination)) {
        Write-Error ("Failed to create $destination")
    }
}

function Do-Work($source, $destination) {
    $tempDestination = $destination.Replace("F:", "C:\tmp\work0718\staging")
    Do-CopyFile $source $tempDestination 
    Do-MoveFile $source $destination
    if ("" -eq (compare-object (get-content $tempDestination) (get-content $destination))) {
        #Write-Host ("Pass")
    }
    else {
        Write-Host ("Fail")
    }
}

